description:
With Atlantic Records (May 1959 - October 1960) began the legend of Coltrane. Simply because he can now compose his own music. \&amp;#039;Coltrane Jazz\&amp;#039; is his second album from this period (as a musician &amp; composer).
A REALLY MUST HAVE for those who love jazz...

